import styled from 'styled-components'

export const Renda = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  flex: 1;

  position: sticky;
  top: 0;
  height: 100vh;
  margin-top: -100vh;
  z-index: 999;

  display: flex;
  flex-direction: column;
  align-items: center;
`

export const Text = styled.div`
  margin-top: 4.5rem;
  text-align: center;
  font-family: Nunito;

  > h1 {
    font-weight: 500;
    font-size: 40px;
    line-height: 48px;
    color: #fff
  }
  > h2 {
    font-weight: normal;
    font-size: 10px;
    line-height: 20px;
    color: #e1f4f3;
  }


`
